fn try_approve<S: Storage, A: Api,
               Q: Querier>(&mut Extern<S, A, Q>, Env, &HumanAddr, &Uint128)
-> StdResult<HandleResponse>

fn try_set_approval_for_all<S: Storage, A: Api,
                            Q: Querier>(&mut Extern<S, A, Q>, Env, &HumanAddr,
                                        &Uint128) -> StdResult<HandleResponse>

fn try_burn<S: Storage, A: Api,
            Q: Querier>(&mut Extern<S, A, Q>, Env, &Uint128)
-> StdResult<HandleResponse>

fn try_mint<S: Storage, A: Api,
            Q: Querier>(&mut Extern<S, A, Q>, Env, &HumanAddr, &Uint128)
-> StdResult<HandleResponse>

pub enum HandleMsg {
    Approve {
        to: HumanAddr,
        token_id: Uint128,
    },
    TransferFrom {
        from: HumanAddr,
        to: HumanAddr,
        token_id: Uint128,
    },
    Mint {
        to: HumanAddr,
        token_id: Uint128,
    },
    Burn {
        token_id: Uint128,
    },
    SetApprovalForAll {
        operator: HumanAddr,
        token_id: Uint128,
    },
    SetTokenURI {
        token_id: Uint128,
        uri: String,
    },
}

pub enum QueryMsg {

    /// Balance of NFT for the address
    BalanceOf {
        address: HumanAddr,
    },

    /// Owner of NFT asset
    OwnerOf {
        token_id: Uint128,
    },

    /// Approved address to transfer asset
    Approved {
        token_id: Uint128,
    },

    /// Approved for all
    ApprovedForAll {
        owner: HumanAddr,
        operator: HumanAddr,
    },

    /// token URI
    TokenURI {
        token_id: Uint128,
    },
}
